            "text": "Váš prohlížeč umožnuje pouze ruční ukládání.\n\nAbyste uložili vaši upravenou wiki, klikněte pravým tlačítkem myši na odkaz ke stažení níže a zvolte \"Stáhnout soubor\" nebo \"Uložit soubor\" a potom vyberte složku a jméno souboru pro uložení.\n\nNa smartphonech, které neumožnují soubory stahovat, můžete odkaz vložit do záložek a záložky synchronizovat s běžným PC. Odtud pak wiki uložíte normálně.\n"
